def _get_time_bins(self, ax):
    if not isinstance(ax, DatetimeIndex):
        raise TypeError("axis must be a DatetimeIndex, but got an instance of {type(ax).__name__}")

    if len(ax) == 0:
        binner = labels = DatetimeIndex(data=[], freq=self.freq, name=ax.name, tz=ax.tz)
        return binner, [], labels

    first, last = _get_range_edges(ax.min(), ax.max(), self.freq, closed=self.closed, base=self.base)
    binner = labels = date_range(
        start=first,
        end=last,
        freq=self.freq,
        tz=ax.tz,
        name=ax.name,
        closed=self.closed
    )

    # _adjust_bin_edges modifies binner and bin_edges, use the returned values
    binner, bin_edges = self._adjust_bin_edges(binner, ax)

    bins = lib.generate_bins_dt64(ax.asi8, bin_edges, self.closed, hasnans=ax.hasnans)

    if self.closed == "right":
        if self.label == "right":
            labels = labels[1:]
    elif self.label == "right":
        labels = labels[1:]

    if ax.hasnans:
        binner = binner.insert(0, NaT)
        labels = labels.insert(0, NaT)

    if len(bins) < len(labels):
        labels = labels[: len(bins)]

    return binner, bins, labels
